      SELECT DISTINCT - 1 / - ( - col1 ) + ( + 35 ) + + col1 + col1 * + col2 FROM tab0 (FORMAT parquet) AS cor0 WHERE + col2 - + col2 - + 35 NOT BETWEEN + - col2 AND NULL;
  - name: tab0

outputs:
  - name: q10167.out
    data: |
      266
